  input: TEXT,SA11A1,SA11A1.58160,"On 4/21/06 we received a contribution from Trevor
    Gray in the amount of $25,000 which was deposited into our federal account.  We
    also received contributions into our joint fundraising committee, the IN 9th District
    Victory Committee, from Trevor and his wife Edna in the amount of $800 each.  This
    makes ar total contribution of $26,600.  Of the $25,000 contribution, nine thousand
    two hundred dollars was reattributed to Edna Gray.  Six thousand six hundred dollars
    was transferred to our non-federal account, which can accept unlimited contributions
    from individuals on 4/21/06.  A letter was sent to Trevor & Edna Gray advising
    them of how thier contribution was split into our accounts and to offer them a
    chance for a refund.  According to AO 2001-17, the Commission has deemed it sufficient
    to deposit checks exceeding federal limits into the federal account and then to
    make a transfer to the non-federal account for the portion that is over the federal
    limits.  Therefore, year to date aggregate totals reported by Trevor Gray on our
    report is a reflection of the federal portion of the donor's contribution to date."
